/**
 * Load the translet classes from the jar file and return the bytecode.
 *
 * @param source The xsl source
 * @param fullClassName The full name of the translet
 * @return The bytecode array
 */
private byte[][] getBytecodesFromJar(Source source, String fullClassName) {
  String xslFileName = getStylesheetFileName(source);
  File xslFile = null;
  if (xslFileName != null) xslFile = new File(xslFileName);

  // Construct the path for the jar file
  String jarPath = null;
  if (_destinationDirectory != null) jarPath = _destinationDirectory + "/" + _jarFileName;
  else {
    if (xslFile != null && xslFile.getParent() != null)
      jarPath = xslFile.getParent() + "/" + _jarFileName;
    else jarPath = _jarFileName;
  }

  // Return null if the jar file does not exist.
  File file = new File(jarPath);
  if (!file.exists()) return null;

  // Compare the timestamps of the jar file and the xsl file. Return null
  // if the xsl file is newer than the jar file.
  if (xslFile != null && xslFile.exists()) {
    long xslTimestamp = xslFile.lastModified();
    long transletTimestamp = file.lastModified();
    if (transletTimestamp < xslTimestamp) return null;
  }

  // Create a ZipFile object for the jar file
  ZipFile jarFile = null;
  try {
    jarFile = new ZipFile(file);
  } catch (IOException e) {
    return null;
  }

  String transletPath = fullClassName.replace('.', '/');
  String transletAuxPrefix = transletPath + "$";
  String transletFullName = transletPath + ".class";

  List bytecodes = new ArrayList();

  // Iterate through all entries in the jar file to find the
  // translet and auxiliary classes.
  Enumeration entries = jarFile.entries();
  while (entries.hasMoreElements()) {
    ZipEntry entry = (ZipEntry) entries.nextElement();
    String entryName = entry.getName();
    if (entry.getSize() > 0
        && (entryName.equals(transletFullName)
            || (entryName.endsWith(".class") && entryName.startsWith(transletAuxPrefix)))) {
      try {
        InputStream input = jarFile.getInputStream(entry);
        int size = (int) entry.getSize();
        byte[] bytes = new byte[size];
        readFromInputStream(bytes, input, size);
        input.close();
        bytecodes.add(bytes);
      } catch (IOException e) {
        return null;
      }
    }
  }

  // Convert the Vector of byte[] to byte[][].
  final int count = bytecodes.size();
  if (count > 0) {
    final byte[][] result = new byte[count][1];
    for (int i = 0; i < count; i++) {
      result[i] = (byte[]) bytecodes.get(i);
    }

    return result;
  } else return null;
}

void asmifyTypeInfo(StringBuffer buf, String varName, Map labelNames, List infos, String field) {
  if (infos.size() > 0) {
    buf.append("{\n");
    for (int i = 0; i < infos.size(); i++) {
      StackMapType typeInfo = (StackMapType) infos.get(i);
      String localName = varName + "Info" + i;
      int type = typeInfo.getType();
      buf.append("StackMapType ")
          .append(localName)
          .append(" = StackMapType.getTypeInfo( StackMapType.ITEM_")
          .append(StackMapType.ITEM_NAMES[type])
          .append(");\n");

      switch (type) {
        case StackMapType.ITEM_Object: //
          buf.append(localName)
              .append(".setObject(\"")
              .append(typeInfo.getObject())
              .append("\");\n");
          break;

        case StackMapType.ITEM_Uninitialized: //
          declareLabel(buf, labelNames, typeInfo.getLabel());
          buf.append(localName)
              .append(".setLabel(")
              .append(labelNames.get(typeInfo.getLabel()))
              .append(");\n");
          break;
      }
      buf.append(varName)
          .append(".")
          .append(field)
          .append(".add(")
          .append(localName)
          .append(");\n");
    }
    buf.append("}\n");
  }
}

public void bookmark(NymReferenceNode node) {
  // _client.addNymReference(_client.getLoggedInNymId(), node);
  if (node == null) return;
  NymReferenceNode parent = null;
  if (node.getParentGroupId() != -1) {
    for (int i = 0; i < _nymRefs.size(); i++) {
      NymReferenceNode cur = _nymRefs.get(i);
      parent = (NymReferenceNode) cur.getByUniqueId(node.getParentGroupId());
      if (parent != null) break;
    }
  }
  if (parent != null) {
    parent.addChild(node);
  } else {
    // remove dups
    for (int i = 0; i < _nymRefs.size(); i++) {
      ReferenceNode child = _nymRefs.get(i);
      if ((node.getURI() != null) && (node.getURI().equals(child.getURI()))) {
        // its a link to the same URL in the same category
        _nymRefs.remove(i);
        i--;
      }
    }

    int order = node.getSiblingOrder();
    if ((order < 0) || (order >= _nymRefs.size())) {
      _nymRefs.add(node);
    } else {
      _nymRefs.add(order, node);
    }
  }
  saveBookmarks();
}

