/**
 * Adds the current class to a list. This list is used to idetify the path from parent to this
 * class
 *
 * @param result Specifies the object
 * @param classList Specifies the path from root to the current object return
 */
public List addClassToList(Object result, List classList) {

  boolean add = true;
  String className = result.getClass().getName();
  String classBean = className.substring(className.lastIndexOf(Constant.DOT) + 1);
  if (classList.size() > 1) {
    String pathItem = null;
    for (int x = 0; x < classList.size(); x++) {
      pathItem = (String) classList.get(x);
      // System.out.println("BeanName = "+ classBean +" item = "+ item);

      if (classBean.equalsIgnoreCase(pathItem)) {
        add = false;
        break;
      }
    }
  }
  if (add) {
    classList.add(className.substring(className.lastIndexOf(Constant.DOT) + 1));
  }
  return classList;
}

protected void doButtonPressed(int buttonIndex, List selected) {
  switch (buttonIndex) {
    case IDX_EDIT:
      edit((TemplatePersistenceData) selected.get(0), false);
      break;
    case IDX_ADD:
      {
        Object element = selected.get(0);
        Template orig = null;
        String contextTypeId;
        if (element instanceof TemplatePersistenceData) {
          orig = ((TemplatePersistenceData) element).getTemplate();
          contextTypeId = orig.getContextTypeId();
        } else if (element instanceof TemplateContextType) {
          TemplateContextType type = (TemplateContextType) selected.get(0);
          contextTypeId = type.getId();
        } else if (element instanceof ICodeTemplateCategory) {
          // default: text file
          contextTypeId = ((ICodeTemplateCategory) element).getTemplateContextTypes()[0].getId();
        } else {
          return;
        }
        Template newTemplate;
        if (orig != null) {
          newTemplate =
              new Template(
                  "", "", contextTypeId, orig.getPattern(), false); // $NON-NLS-1$//$NON-NLS-2$
        } else {
          newTemplate =
              new Template(
                  "", "", contextTypeId, "", false); // $NON-NLS-1$//$NON-NLS-2$//$NON-NLS-3$
        }
        TemplatePersistenceData newData = new TemplatePersistenceData(newTemplate, true);
        edit(newData, true);
        break;
      }
    case IDX_REMOVE:
      remove((TemplatePersistenceData) selected.get(0));
      break;
    case IDX_EXPORT:
      export(selected);
      break;
    case IDX_EXPORTALL:
      exportAll();
      break;
    case IDX_IMPORT:
      import_();
      break;
  }
}

