/**
 * Draws the category labels and returns the updated axis state.
 *
 * @param g2 the graphics device (<code>null</code> not permitted).
 * @param plotArea the plot area (<code>null</code> not permitted).
 * @param dataArea the area inside the axes (<code>null</code> not permitted).
 * @param edge the axis location (<code>null</code> not permitted).
 * @param state the axis state (<code>null</code> not permitted).
 * @param plotState collects information about the plot (<code>null</code> permitted).
 * @return The updated axis state (never <code>null</code>).
 */
protected AxisState drawSubCategoryLabels(
    Graphics2D g2,
    Rectangle2D plotArea,
    Rectangle2D dataArea,
    RectangleEdge edge,
    AxisState state,
    PlotRenderingInfo plotState) {

  if (state == null) {
    throw new IllegalArgumentException("Null 'state' argument.");
  }

  g2.setFont(this.subLabelFont);
  g2.setPaint(this.subLabelPaint);
  CategoryPlot plot = (CategoryPlot) getPlot();
  int categoryCount = 0;
  CategoryDataset dataset = plot.getDataset();
  if (dataset != null) {
    categoryCount = dataset.getColumnCount();
  }

  double maxdim = getMaxDim(g2, edge);
  for (int categoryIndex = 0; categoryIndex < categoryCount; categoryIndex++) {

    double x0 = 0.0;
    double x1 = 0.0;
    double y0 = 0.0;
    double y1 = 0.0;
    if (edge == RectangleEdge.TOP) {
      x0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      x1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      y1 = state.getCursor();
      y0 = y1 - maxdim;
    } else if (edge == RectangleEdge.BOTTOM) {
      x0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      x1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      y0 = state.getCursor();
      y1 = y0 + maxdim;
    } else if (edge == RectangleEdge.LEFT) {
      y0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      y1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      x1 = state.getCursor();
      x0 = x1 - maxdim;
    } else if (edge == RectangleEdge.RIGHT) {
      y0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      y1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      x0 = state.getCursor();
      x1 = x0 + maxdim;
    }
    Rectangle2D area = new Rectangle2D.Double(x0, y0, (x1 - x0), (y1 - y0));
    int subCategoryCount = this.subCategories.size();
    float width = (float) ((x1 - x0) / subCategoryCount);
    float height = (float) ((y1 - y0) / subCategoryCount);
    float xx = 0.0f;
    float yy = 0.0f;
    for (int i = 0; i < subCategoryCount; i++) {
      if (RectangleEdge.isTopOrBottom(edge)) {
        xx = (float) (x0 + (i + 0.5) * width);
        yy = (float) area.getCenterY();
      } else {
        xx = (float) area.getCenterX();
        yy = (float) (y0 + (i + 0.5) * height);
      }
      String label = this.subCategories.get(i).toString();
      TextUtilities.drawRotatedString(
          label, g2, xx, yy, TextAnchor.CENTER, 0.0, TextAnchor.CENTER);
    }
  }

  if (edge.equals(RectangleEdge.TOP)) {
    double h = maxdim;
    state.cursorUp(h);
  } else if (edge.equals(RectangleEdge.BOTTOM)) {
    double h = maxdim;
    state.cursorDown(h);
  } else if (edge == RectangleEdge.LEFT) {
    double w = maxdim;
    state.cursorLeft(w);
  } else if (edge == RectangleEdge.RIGHT) {
    double w = maxdim;
    state.cursorRight(w);
  }
  return state;
}

/**
 * Draws the plot on a Java 2D graphics device (such as the screen or a printer). Will perform all
 * the placement calculations for each sub-plots and then tell these to draw themselves.
 *
 * @param g2 the graphics device.
 * @param area the area within which the plot (including axis labels) should be drawn.
 * @param anchor the anchor point (<code>null</code> permitted).
 * @param parentState the parent state.
 * @param info collects information about the drawing (<code>null</code> permitted).
 */
public void draw(
    Graphics2D g2,
    Rectangle2D area,
    Point2D anchor,
    PlotState parentState,
    PlotRenderingInfo info) {

  // set up info collection...
  if (info != null) {
    info.setPlotArea(area);
  }

  // adjust the drawing area for plot insets (if any)...
  RectangleInsets insets = getInsets();
  insets.trim(area);

  // calculate the data area...
  AxisSpace space = calculateAxisSpace(g2, area);
  Rectangle2D dataArea = space.shrink(area, null);

  // set the width and height of non-shared axis of all sub-plots
  setFixedDomainAxisSpaceForSubplots(space);

  // draw the shared axis
  ValueAxis axis = getRangeAxis();
  RectangleEdge rangeEdge = getRangeAxisEdge();
  double cursor = RectangleEdge.coordinate(dataArea, rangeEdge);
  AxisState state = axis.draw(g2, cursor, area, dataArea, rangeEdge, info);
  if (parentState == null) {
    parentState = new PlotState();
  }
  parentState.getSharedAxisStates().put(axis, state);

  // draw all the charts
  for (int i = 0; i < this.subplots.size(); i++) {
    CategoryPlot plot = (CategoryPlot) this.subplots.get(i);
    PlotRenderingInfo subplotInfo = null;
    if (info != null) {
      subplotInfo = new PlotRenderingInfo(info.getOwner());
      info.addSubplotInfo(subplotInfo);
    }
    Point2D subAnchor = null;
    if (anchor != null && this.subplotArea[i].contains(anchor)) {
      subAnchor = anchor;
    }
    plot.draw(g2, this.subplotArea[i], subAnchor, parentState, subplotInfo);
  }

  if (info != null) {
    info.setDataArea(dataArea);
  }
}

