/**
 * Concatenates a bunch of header values, seperating them with a comma.
 *
 * @param values List of header values.
 * @return String of all headers, with commas.
 */
private String concatenateList(List values) {
  StringBuffer buf = new StringBuffer();
  for (int i = 0, size = values.size(); i < size; ++i) {
    buf.append(((String) values.get(i)).replaceAll("\n", "").trim());
    if (i != (size - 1)) {
      buf.append(",");
    }
  }
  return buf.toString();
}

private List exclude(List modelElements, IScriptProject project, IProgressMonitor monitor)
    throws ModelException {
  if (monitor == null) monitor = new NullProgressMonitor();
  try {
    monitor.beginTask(
        NewWizardMessages.BuildpathModifier_Monitor_Excluding, modelElements.size() + 4);
    List existingEntries = BuildpathModifier.getExistingEntries(project);
    List resources = new ArrayList();
    for (int i = 0; i < modelElements.size(); i++) {
      IModelElement modelElement = (IModelElement) modelElements.get(i);
