/**
 * Make sure there is an attribute mapping for each target Attribute in the supplied List. Remove
 * any extras.
 *
 * @param transMappingRoot the Transformation MappingRoot
 * @param targetAttrs the List of target attributes
 * @param txnSource the source for the transaction
 * @return true if any data was changed.
 */
private static boolean reconcileAttributeMappings(
    Object transMappingRoot, List targetAttrs, Object txnSource) {
  boolean changed = false;
  if (TransformationHelper.isTransformationMappingRoot(transMappingRoot) && targetAttrs != null) {
    // start txn if not already in txn
    boolean requiredStart =
        ModelerCore.startTxn(
            NOT_SIGNIFICANT, IS_UNDOABLE, "Reconcile attr mappings", txnSource); // $NON-NLS-1$
    boolean succeeded = false;
    try {
      // Get the current mapped attributes
      List currentMappedAttributes = getMappedAttributes(transMappingRoot);

      // Create Mappings for those missing
      Iterator iter = targetAttrs.iterator();
      while (iter.hasNext()) {
        EObject targetAttr = (EObject) iter.next();
        // If new target is not already mapped, add it
        if (!currentMappedAttributes.contains(targetAttr)) {
          // Create the Attribute Mapping - nested under mapping root
          TransformationFactory mappingFactory = TransformationFactory.eINSTANCE;
          Mapping attrMapping = mappingFactory.createTransformationMapping();
          attrMapping.setNestedIn((MappingRoot) transMappingRoot);

          // Set the output to the supplied target
          List outputs = attrMapping.getOutputs();
          outputs.add(targetAttr);
          changed = true;
        }
      }

      // Remove extraneous mappings
      for (int i = currentMappedAttributes.size() - 1; i >= 0; i--) {
        EObject mappingAttr = (EObject) currentMappedAttributes.get(i);
        if (!targetAttrs.contains(mappingAttr)) {
          removeAttributeMapping(transMappingRoot, mappingAttr, txnSource);
          changed = true;
        }
      }
      succeeded = true;
    } finally {
      // If we start txn, commit it
      if (requiredStart) {
        if (succeeded) {
          ModelerCore.commitTxn();
        } else {
          ModelerCore.rollbackTxn();
        }
      }
    }
  }
  return changed;
}

/**
 * Check / assure this function name is defined.
 *
 * @param name the role name.
 */
protected void checkFunctionName(String name) {
  if (name == null) return;
  name = name.intern();

  // check the cache to see if the function name already exists
  if (m_functionCache.contains(name)) return;

  // see if we have this on the db
  String statement = dbAuthzGroupSql.getCountRealmFunctionSql();
  Object[] fields = new Object[1];
  fields[0] = name;

  List results =
      sqlService()
          .dbRead(
              statement,
              fields,
              new SqlReader() {
                public Object readSqlResultRecord(ResultSet result) {
                  try {
                    int count = result.getInt(1);
                    return Integer.valueOf(count);
                  } catch (SQLException ignore) {
                    return null;
                  }
                }
              });

  boolean rv = false;
  if (!results.isEmpty()) {
    rv = ((Integer) results.get(0)).intValue() > 0;
  }

  // write if we didn't find it
  if (!rv) {
    statement = dbAuthzGroupSql.getInsertRealmFunctionSql();
    // write, but if it fails, we don't really care - it will fail if another app server has just
    // written this function
    sqlService().dbWriteFailQuiet(null, statement, fields);
  }

  // cache the existance of the function name
  synchronized (m_functionCache) {
    m_functionCache.add(name);
  }
}

/**
 * This method determines if the given field is a button.
 *
 * @param field the field to determine
 * @return the result of the determination
 * @throws IOException If there is an error determining the field type.
 */
private static boolean isButton(PDField field) throws IOException {
  String ft = field.findFieldType();
  boolean retval = FIELD_TYPE_BTN.equals(ft);
  List kids = field.getKids();
  if (ft == null && kids != null && kids.size() > 0) {
    // sometimes if it is a button the type is only defined by one
    // of the kids entries
    Object obj = kids.get(0);
    COSDictionary kidDict = null;
    if (obj instanceof PDField) {
      kidDict = ((PDField) obj).getDictionary();
    } else if (obj instanceof PDAnnotationWidget) {
      kidDict = ((PDAnnotationWidget) obj).getDictionary();
    } else {
      throw new IOException("Error:Unexpected type of kids field:" + obj);
    }
    retval = isButton(new PDUnknownField(field.getAcroForm(), kidDict));
  }
  return retval;
}

