/**
 * The <code>CopyAction</code> implementation of this <code>SelectionListenerAction</code> method
 * enables this action if one or more resources of compatible types are selected.
 */
protected boolean updateSelection(IStructuredSelection selection) {
  if (!super.updateSelection(selection)) {
    return false;
  }

  if (getSelectedNonResources().size() > 0) {
    return false;
  }

  List selectedResources = getSelectedResources();
  if (selectedResources.size() == 0) {
    return false;
  }

  boolean projSelected = selectionIsOfType(IResource.PROJECT);
  boolean fileFoldersSelected = selectionIsOfType(IResource.FILE | IResource.FOLDER);
  if (!projSelected && !fileFoldersSelected) {
    return false;
  }

  // selection must be homogeneous
  if (projSelected && fileFoldersSelected) {
    return false;
  }

  // must have a common parent
  IContainer firstParent = ((IResource) selectedResources.get(0)).getParent();
  if (firstParent == null) {
    return false;
  }

  Iterator resourcesEnum = selectedResources.iterator();
  while (resourcesEnum.hasNext()) {
    IResource currentResource = (IResource) resourcesEnum.next();
    if (!currentResource.getParent().equals(firstParent)) {
      return false;
    }
    // resource location must exist
    if (currentResource.getLocation() == null) {
      return false;
    }
  }

  return true;
}

/** Handle an exception thrown by a Run element. */
public RewrittenUrl handleInvocationTargetException(
    final HttpServletRequest hsRequest,
    final HttpServletResponse hsResponse,
    InvocationTargetException e)
    throws ServletException, IOException {

  Throwable originalThrowable = getOriginalException(e);

  if (log.isDebugEnabled()) {
    log.debug("attampting to find catch for exception " + originalThrowable.getClass().getName());
  }

  List catchElems = conf.getCatchElems();
  for (int i = 0; i < catchElems.size(); i++) {
    CatchElem catchElem = (CatchElem) catchElems.get(i);
    if (!catchElem.matches(originalThrowable)) continue;
    try {
      return catchElem.execute(hsRequest, hsResponse, originalThrowable);

    } catch (InvocationTargetException invocationExceptionInner) {
      originalThrowable = getOriginalException(invocationExceptionInner);
      log.warn(
          "had exception processing catch, trying the rest of the catches with "
              + originalThrowable.getClass().getName());
    }
  }

  if (log.isDebugEnabled()) {
    log.debug("exception unhandled", e);
  }
  if (originalThrowable instanceof Error) throw (Error) originalThrowable;
  if (originalThrowable instanceof RuntimeException) throw (RuntimeException) originalThrowable;
  if (originalThrowable instanceof ServletException) throw (ServletException) originalThrowable;
  if (originalThrowable instanceof IOException) throw (IOException) originalThrowable;
  throw new ServletException(originalThrowable);
}

static String generateAND(Element and) {
  StringBuffer out = new StringBuffer();

  List list = and.getChildren();
  // if (list.size()!=2)return "error <and> token must have two arguments";
  if (list.size() < 1) return "error <and> token must have atleast one argument";

  out.append("(");
  for (int i = 0; i < list.size(); i++) {
    Element elm = (Element) list.get(i);
    if (i > 0) out.append(" and ");
    out.append(generateOP(elm));
  }
  out.append(")");

  // Element left = (Element)and.getChildren().get(0);
  // Element right = (Element)and.getChildren().get(1);

  // out.append("("+generateOP(left));
  // out.append(" and ");
  // out.append(generateOP(right)+")");

  return out.toString();
}

public E get(int index) {
  synchronized (elements) {
    Object o = elements.get(index);

    if (getHelper().unresolvedSuspect(o)) {
      // read this page
      int pageStart = pageIndex(index) * pageSize;
      resolveInterval(pageStart, pageStart + pageSize);

      return (E) elements.get(index);
    } else {
      return (E) o;
    }
  }
}

/**
 * Returns the list of URLs added to the classpath by the extra classpath entries extension point
 * for an Ant build that is occurring without the Eclipse runtime.
 *
 * @return the list of extra classpath URLs
 * @since 3.0
 */
public URL[] getRemoteExtraClasspathURLs() {
  List urls = new ArrayList(extraClasspathURLs.size());

  for (int i = 0; i < extraClasspathURLs.size(); i++) {
    IAntClasspathEntry entry = (IAntClasspathEntry) extraClasspathURLs.get(i);
    if (!entry.isEclipseRuntimeRequired()) {
      urls.add(entry.getEntryURL());
    }
  }
  return (URL[]) urls.toArray(new URL[urls.size()]);
}

