/**
 * Tests the daily calendar view output together with some series of yearly interval entries.
 *
 * <p>
 *
 * @throws Exception if something goes wrong
 */
public void testDailyViewYearlySeries() throws Exception {

  // create a test calendar
  CmsCalendar testCal = new CmsCalendar();

  // create first serial calendar entry
  CmsCalendarEntry entry = new CmsCalendarEntry();
  CmsCalendarEntryData data = new CmsCalendarEntryData();
  data.setTitle("First serial test entry");
  data.setDescription("Every 3rd Monday of April.");
  CmsCalendarEntryDateSerial serialDate =
      new CmsCalendarEntryDateSerial(
          new GregorianCalendar(2007, 0, 1, 8, 40), new GregorianCalendar(2007, 0, 1, 8, 50));
  serialDate.setSerialEndType(I_CmsCalendarSerialDateOptions.END_TYPE_NEVER);

  I_CmsCalendarSerialDateOptions serialOptions =
      new CmsCalendarSerialDateYearlyOptions(3, Calendar.MONDAY, 3);

  serialDate.setSerialOptions(serialOptions);
  entry.setEntryData(data);
  entry.setEntryDate(serialDate);
  testCal.addEntry(entry);

  // create the list of view dates from Jan 2007 to Dec 2009
  List viewDates = new ArrayList();
  CmsCalendarEntryDate viewDate =
      new CmsCalendarEntryDate(
          new GregorianCalendar(2007, 0, 1, 0, 0, 0),
          new GregorianCalendar(2009, 11, 31, 23, 59, 59));
  viewDates.add(viewDate);
  // create the daily view
  CmsCalendarViewSimple view = new CmsCalendarViewSimple(viewDates);
  List result = testCal.getEntries(view);
  // there should be 3 entries, one in each year
  assertEquals(3, result.size());
  // additional checks
  for (int i = 0; i < result.size(); i++) {
    CmsCalendarEntry resEntry = (CmsCalendarEntry) result.get(i);
    assertEquals("First serial test entry", resEntry.getEntryData().getTitle());
    if (i == 0) {
      assertEquals(
          new GregorianCalendar(2007, 3, 16, 8, 40), resEntry.getEntryDate().getStartDate());
      assertEquals(
          new GregorianCalendar(2007, 3, 16, 8, 50), resEntry.getEntryDate().getEndDate());
    }
    if (i == 1) {
      assertEquals(
          new GregorianCalendar(2008, 3, 21, 8, 40), resEntry.getEntryDate().getStartDate());
      assertEquals(
          new GregorianCalendar(2008, 3, 21, 8, 50), resEntry.getEntryDate().getEndDate());
    }
    if (i == 2) {
      assertEquals(
          new GregorianCalendar(2009, 3, 20, 8, 40), resEntry.getEntryDate().getStartDate());
      assertEquals(
          new GregorianCalendar(2009, 3, 20, 8, 50), resEntry.getEntryDate().getEndDate());
    }
  }

  // remove first entry
  testCal.getEntries().remove(0);

  // create second serial calendar entry
  entry = new CmsCalendarEntry();
  data = new CmsCalendarEntryData();
  data.setTitle("Second serial test entry");
  data.setDescription("Every 15th of November to 2015.");
  serialDate =
      new CmsCalendarEntryDateSerial(
          new GregorianCalendar(2007, 0, 15, 15, 20), new GregorianCalendar(2007, 0, 15, 20, 20));
  serialDate.setSerialEndType(I_CmsCalendarSerialDateOptions.END_TYPE_DATE);
  serialDate.setSerialEndDate(new GregorianCalendar(2015, 11, 31));

  serialOptions = new CmsCalendarSerialDateYearlyOptions(15, -1, 10);

  serialDate.setSerialOptions(serialOptions);
  entry.setEntryData(data);
  entry.setEntryDate(serialDate);
  testCal.addEntry(entry);

  // create the list of view dates from Sun, 09/16/2007 to Mon, 09/24/2007
  viewDates = new ArrayList();
  viewDate =
      new CmsCalendarEntryDate(
          new GregorianCalendar(2007, 0, 1, 0, 0, 0),
          new GregorianCalendar(2032, 11, 31, 23, 59, 59));
  viewDates.add(viewDate);
  // create the daily view
  view = new CmsCalendarViewSimple(viewDates);
  result = testCal.getEntries(view);
  // there should be 9 entries from 2007 to 2015
  assertEquals(9, result.size());
}

/**
 * For every pragma in the list, calls {@link Pragma#before(XQueryContext, Expression)} before
 * evaluation. The method then tries to call {@link Pragma#eval(Sequence, Item)} on every pragma.
 * If a pragma does not return null for this call, the returned Sequence will become the result of
 * the extension expression. If more than one pragma returns something for eval, an exception will
 * be thrown. If all pragmas return null, we call eval on the original expression and return that.
 */
public Sequence eval(Sequence contextSequence, Item contextItem) throws XPathException {
  callBefore();
  Sequence result = null;
  for (int i = 0; i < pragmas.size(); i++) {
    Pragma pragma = (Pragma) pragmas.get(i);
    Sequence temp = pragma.eval(contextSequence, contextItem);
    if (temp != null) {
      if (result != null)
        throw new XPathException(
            getASTNode(), "Conflicting pragmas: only one should return a result for eval");
      result = temp;
    }
  }

  if (result == null) result = innerExpression.eval(contextSequence, contextItem);
  callAfter();
  return result;
}

private void execute(final int opcode, final int iarg, final String sarg) {
  if (this.locals == null) {
    return;
  }
  Object t1, t2, t3, t4;
  switch (opcode) {
    case Opcodes.NOP:
    case Opcodes.INEG:
    case Opcodes.LNEG:
    case Opcodes.FNEG:
    case Opcodes.DNEG:
    case Opcodes.I2B:
    case Opcodes.I2C:
    case Opcodes.I2S:
    case Opcodes.GOTO:
    case Opcodes.RETURN:
      break;
    case Opcodes.ACONST_NULL:
      push(Opcodes.NULL);
      break;
    case Opcodes.ICONST_M1:
    case Opcodes.ICONST_0:
    case Opcodes.ICONST_1:
    case Opcodes.ICONST_2:
    case Opcodes.ICONST_3:
    case Opcodes.ICONST_4:
    case Opcodes.ICONST_5:
    case Opcodes.BIPUSH:
    case Opcodes.SIPUSH:
      push(Opcodes.INTEGER);
      break;
    case Opcodes.LCONST_0:
    case Opcodes.LCONST_1:
      push(Opcodes.LONG);
      push(Opcodes.TOP);
      break;
    case Opcodes.FCONST_0:
    case Opcodes.FCONST_1:
    case Opcodes.FCONST_2:
      push(Opcodes.FLOAT);
      break;
    case Opcodes.DCONST_0:
    case Opcodes.DCONST_1:
      push(Opcodes.DOUBLE);
      push(Opcodes.TOP);
      break;
    case Opcodes.ILOAD:
    case Opcodes.FLOAD:
    case Opcodes.ALOAD:
      push(get(iarg));
      break;
    case Opcodes.LLOAD:
    case Opcodes.DLOAD:
      push(get(iarg));
      push(Opcodes.TOP);
      break;
    case Opcodes.IALOAD:
    case Opcodes.BALOAD:
    case Opcodes.CALOAD:
    case Opcodes.SALOAD:
      pop(2);
      push(Opcodes.INTEGER);
      break;
    case Opcodes.LALOAD:
    case Opcodes.D2L:
      pop(2);
      push(Opcodes.LONG);
      push(Opcodes.TOP);
      break;
    case Opcodes.FALOAD:
      pop(2);
      push(Opcodes.FLOAT);
      break;
    case Opcodes.DALOAD:
    case Opcodes.L2D:
      pop(2);
      push(Opcodes.DOUBLE);
      push(Opcodes.TOP);
      break;
    case Opcodes.AALOAD:
      pop(1);
      t1 = pop();
      pushDesc(((String) t1).substring(1));
      break;
    case Opcodes.ISTORE:
    case Opcodes.FSTORE:
    case Opcodes.ASTORE:
      t1 = pop();
      set(iarg, t1);
      if (iarg > 0) {
        t2 = get(iarg - 1);
        if (t2 == Opcodes.LONG || t2 == Opcodes.DOUBLE) {
          set(iarg - 1, Opcodes.TOP);
        }
      }
      break;
    case Opcodes.LSTORE:
    case Opcodes.DSTORE:
      pop(1);
      t1 = pop();
      set(iarg, t1);
      set(iarg + 1, Opcodes.TOP);
      if (iarg > 0) {
        t2 = get(iarg - 1);
        if (t2 == Opcodes.LONG || t2 == Opcodes.DOUBLE) {
          set(iarg - 1, Opcodes.TOP);
        }
      }
      break;
    case Opcodes.IASTORE:
    case Opcodes.BASTORE:
    case Opcodes.CASTORE:
    case Opcodes.SASTORE:
    case Opcodes.FASTORE:
    case Opcodes.AASTORE:
      pop(3);
      break;
    case Opcodes.LASTORE:
    case Opcodes.DASTORE:
      pop(4);
      break;
    case Opcodes.POP:
    case Opcodes.IFEQ:
    case Opcodes.IFNE:
    case Opcodes.IFLT:
    case Opcodes.IFGE:
    case Opcodes.IFGT:
    case Opcodes.IFLE:
    case Opcodes.IRETURN:
    case Opcodes.FRETURN:
    case Opcodes.ARETURN:
    case Opcodes.TABLESWITCH:
    case Opcodes.LOOKUPSWITCH:
    case Opcodes.ATHROW:
    case Opcodes.MONITORENTER:
    case Opcodes.MONITOREXIT:
    case Opcodes.IFNULL:
    case Opcodes.IFNONNULL:
      pop(1);
      break;
    case Opcodes.POP2:
    case Opcodes.IF_ICMPEQ:
    case Opcodes.IF_ICMPNE:
    case Opcodes.IF_ICMPLT:
    case Opcodes.IF_ICMPGE:
    case Opcodes.IF_ICMPGT:
    case Opcodes.IF_ICMPLE:
    case Opcodes.IF_ACMPEQ:
    case Opcodes.IF_ACMPNE:
    case Opcodes.LRETURN:
    case Opcodes.DRETURN:
      pop(2);
      break;
    case Opcodes.DUP:
      t1 = pop();
      push(t1);
      push(t1);
      break;
    case Opcodes.DUP_X1:
      t1 = pop();
      t2 = pop();
      push(t1);
      push(t2);
      push(t1);
      break;
    case Opcodes.DUP_X2:
      t1 = pop();
      t2 = pop();
      t3 = pop();
      push(t1);
      push(t3);
      push(t2);
      push(t1);
      break;
    case Opcodes.DUP2:
      t1 = pop();
      t2 = pop();
      push(t2);
      push(t1);
      push(t2);
      push(t1);
      break;
    case Opcodes.DUP2_X1:
      t1 = pop();
      t2 = pop();
      t3 = pop();
      push(t2);
      push(t1);
      push(t3);
      push(t2);
      push(t1);
      break;
    case Opcodes.DUP2_X2:
      t1 = pop();
      t2 = pop();
      t3 = pop();
      t4 = pop();
      push(t2);
      push(t1);
      push(t4);
      push(t3);
      push(t2);
      push(t1);
      break;
    case Opcodes.SWAP:
      t1 = pop();
      t2 = pop();
      push(t1);
      push(t2);
      break;
    case Opcodes.IADD:
    case Opcodes.ISUB:
    case Opcodes.IMUL:
    case Opcodes.IDIV:
    case Opcodes.IREM:
    case Opcodes.IAND:
    case Opcodes.IOR:
    case Opcodes.IXOR:
    case Opcodes.ISHL:
    case Opcodes.ISHR:
    case Opcodes.IUSHR:
    case Opcodes.L2I:
    case Opcodes.D2I:
    case Opcodes.FCMPL:
    case Opcodes.FCMPG:
      pop(2);
      push(Opcodes.INTEGER);
      break;
    case Opcodes.LADD:
    case Opcodes.LSUB:
    case Opcodes.LMUL:
    case Opcodes.LDIV:
    case Opcodes.LREM:
    case Opcodes.LAND:
    case Opcodes.LOR:
    case Opcodes.LXOR:
      pop(4);
      push(Opcodes.LONG);
      push(Opcodes.TOP);
      break;
    case Opcodes.FADD:
    case Opcodes.FSUB:
    case Opcodes.FMUL:
    case Opcodes.FDIV:
    case Opcodes.FREM:
    case Opcodes.L2F:
    case Opcodes.D2F:
      pop(2);
      push(Opcodes.FLOAT);
      break;
    case Opcodes.DADD:
    case Opcodes.DSUB:
    case Opcodes.DMUL:
    case Opcodes.DDIV:
    case Opcodes.DREM:
      pop(4);
      push(Opcodes.DOUBLE);
      push(Opcodes.TOP);
      break;
    case Opcodes.LSHL:
    case Opcodes.LSHR:
    case Opcodes.LUSHR:
      pop(3);
      push(Opcodes.LONG);
      push(Opcodes.TOP);
      break;
    case Opcodes.IINC:
      set(iarg, Opcodes.INTEGER);
      break;
    case Opcodes.I2L:
    case Opcodes.F2L:
      pop(1);
      push(Opcodes.LONG);
      push(Opcodes.TOP);
      break;
    case Opcodes.I2F:
      pop(1);
      push(Opcodes.FLOAT);
      break;
    case Opcodes.I2D:
    case Opcodes.F2D:
      pop(1);
      push(Opcodes.DOUBLE);
      push(Opcodes.TOP);
      break;
    case Opcodes.F2I:
    case Opcodes.ARRAYLENGTH:
    case Opcodes.INSTANCEOF:
      pop(1);
      push(Opcodes.INTEGER);
      break;
    case Opcodes.LCMP:
    case Opcodes.DCMPL:
    case Opcodes.DCMPG:
      pop(4);
      push(Opcodes.INTEGER);
      break;
    case Opcodes.JSR:
    case Opcodes.RET:
      throw new RuntimeException("JSR/RET are not supported");
    case Opcodes.GETSTATIC:
      pushDesc(sarg);
      break;
    case Opcodes.PUTSTATIC:
      pop(sarg);
      break;
    case Opcodes.GETFIELD:
      pop(1);
      pushDesc(sarg);
      break;
    case Opcodes.PUTFIELD:
      pop(sarg);
      pop();
      break;
    case Opcodes.NEW:
      push(labels.get(0));
      break;
    case Opcodes.NEWARRAY:
      pop();
      switch (iarg) {
        case Opcodes.T_BOOLEAN:
          pushDesc("[Z");
          break;
        case Opcodes.T_CHAR:
          pushDesc("[C");
          break;
        case Opcodes.T_BYTE:
          pushDesc("[B");
          break;
        case Opcodes.T_SHORT:
          pushDesc("[S");
          break;
        case Opcodes.T_INT:
          pushDesc("[I");
          break;
        case Opcodes.T_FLOAT:
          pushDesc("[F");
          break;
        case Opcodes.T_DOUBLE:
          pushDesc("[D");
          break;
          // case Opcodes.T_LONG:
        default:
          pushDesc("[J");
          break;
      }
      break;
    case Opcodes.ANEWARRAY:
      pop();
      pushDesc("[" + Type.getObjectType(sarg));
      break;
    case Opcodes.CHECKCAST:
      pop();
      pushDesc(Type.getObjectType(sarg).getDescriptor());
      break;
      // case Opcodes.MULTIANEWARRAY:
    default:
      pop(iarg);
      pushDesc(sarg);
      break;
  }
  labels = null;
}

