public static void addImportedOperationToService(
    MethodType method, SpecificServiceInformation serviceInfo) throws Exception {

  String fromDocFile =
      serviceInfo.getBaseDirectory().getAbsolutePath()
          + File.separator
          + "schema"
          + File.separator
          + serviceInfo
              .getIntroduceServiceProperties()
              .getProperty(IntroduceConstants.INTRODUCE_SKELETON_SERVICE_NAME)
          + File.separator
          + method.getImportInformation().getWsdlFile();
  String toDocFile =
      serviceInfo.getBaseDirectory().getAbsolutePath()
          + File.separator
          + "schema"
          + File.separator
          + serviceInfo
              .getIntroduceServiceProperties()
              .getProperty(IntroduceConstants.INTRODUCE_SKELETON_SERVICE_NAME)
          + File.separator
          + serviceInfo.getService().getName()
          + ".wsdl";
  if (!(new File(fromDocFile).exists())) {
    // try From Globus Location
    fromDocFile =
        CommonTools.getGlobusLocation()
            + File.separator
            + "share"
            + File.separator
            + "schema"
            + File.separator
            + "wsrf"
            + File.separator
            + method.getImportInformation().getWsdlFile();
    logger.info(
        "Imported operation's WSDL not found in service directory, using WSDL from globus...");
  }
  if (!(new File(fromDocFile).exists())) {
    throw new Exception(
        "Cannot locate WSDL file: "
            + fromDocFile
            + " to import from for Method: "
            + method.getName());
  }

  // parse the wsdl and get the operation text.....
  Document fromWsdl = null;
  Document toWsdl = null;
  try {
    // read the wsdl we're importing an operation FROM
    fromWsdl = XMLUtilities.fileNameToDocument(fromDocFile);
    // read the service's wsdl we're writing TO
    toWsdl = XMLUtilities.fileNameToDocument(toDocFile);
  } catch (IOException ex) {
    logger.error(ex);
    throw ex;
  }

  // get the port type we're importing from
  Element importPortType =
      getPortTypeElement(
          fromWsdl.getRootElement(), method.getImportInformation().getPortTypeName());
  if (importPortType == null) {
    String message =
        "Unable to locate port type in imported WSDL ("
            + method.getImportInformation().getPortTypeName()
            + ")";
    logger.error(message);
    throw new SynchronizationException(message);
  }
  // get the operation from the import's port type
  Element importOperation = getOperationElement(importPortType, method.getName());
  if (importOperation == null) {
    String message =
        "Unable to locate operation in imported port type (" + method.getName() + ")";
    logger.error(message);
    throw new SynchronizationException(message);
  }
  // detach the operation element so we can add it to our own WSDL later
  Element copyOperation = (Element) importOperation.detach();
  // find the port type within the service we're importing a method INTO
  Element servicePortType =
      getPortTypeElement(
          toWsdl.getRootElement(), serviceInfo.getService().getName() + "PortType");
  if (servicePortType == null) {
    String message =
        "Unable to locate port type in service's WSDL ("
            + serviceInfo.getService().getName()
            + "PortType)";
    logger.error(message);
    throw new SynchronizationException(message);
  }
  // fix up the namespaceing of the imported operation
  List copyElemChildren = copyOperation.getChildren();
  Iterator childIter = copyElemChildren.iterator();
  while (childIter.hasNext()) {
    Element copyChild = (Element) childIter.next();
    String messageString = copyChild.getAttributeValue("message");
    logger.debug("Looking for namespace prefix for message " + messageString);
    Namespace ns = null;
    String prefix = "";
    String message = "";
    if (messageString.indexOf(":") >= 0) {
      prefix = messageString.substring(0, messageString.indexOf(":"));
      message = messageString.substring(messageString.indexOf(":") + 1);
      ns = fromWsdl.getRootElement().getNamespace(prefix);
    } else {
      message = messageString;
      ns = fromWsdl.getRootElement().getNamespace();
    }
    List toNamespaces = toWsdl.getRootElement().getAdditionalNamespaces();
    for (int namespaceIndex = 0; namespaceIndex < toNamespaces.size(); namespaceIndex++) {
      Namespace tempns = (Namespace) toNamespaces.get(namespaceIndex);
      if (tempns.getURI().equals(ns.getURI())) {
        logger.debug("Setting message " + message + " nsPrefix: " + tempns.getPrefix());
        copyChild.setAttribute("message", tempns.getPrefix() + ":" + message);
        break;
      }
    }
  }
  // add the operation to our service's port type
  servicePortType.addContent(copyOperation);

  // write out the modified service WSDL
  try {
    FileWriter fw = new FileWriter(toDocFile);
    fw.write(XMLUtilities.formatXML(XMLUtilities.documentToString(toWsdl)));
    fw.close();
  } catch (IOException ex) {
    String message = "Error writing modified service WSDL: " + ex.getMessage();
    logger.error(message, ex);
    throw new SynchronizationException(message, ex);
  }
}

private String listReadLocks() {
  StringBuffer buf = new StringBuffer();
  for (int i = 0; i < outstandingReadLocks.size(); i++) {
    LockOwner owner = (LockOwner) outstandingReadLocks.get(i);
    buf.append(' ');
    buf.append(((Thread) owner.getOwner()).getName());
  }
  return buf.toString();
}

protected String readUnifiedDiff(
    List<FilePatch2> diffs, LineReader reader, String line, String args, String fileName)
    throws IOException {

  String[] oldArgs = split(line.substring(4));

  // read info about new file
  line = reader.readLine();
  if (line == null || !line.startsWith("+++ ")) // $NON-NLS-1$
  return line;

  String[] newArgs = split(line.substring(4));

  FilePatch2 diff =
      createFileDiff(
          extractPath(oldArgs, 0, fileName),
          extractDate(oldArgs, 1),
          extractPath(newArgs, 0, fileName),
          extractDate(newArgs, 1));
  diffs.add(diff);

  int[] oldRange = new int[2];
  int[] newRange = new int[2];
  int remainingOld = -1; // remaining old lines for current hunk
  int remainingNew = -1; // remaining new lines for current hunk
  List<String> lines = new ArrayList<>();

  boolean encounteredPlus = false;
  boolean encounteredMinus = false;
  boolean encounteredSpace = false;

  try {
    // read lines of hunk
    while (true) {

      line = reader.readLine();
      if (line == null) return null;

      if (reader.lineContentLength(line) == 0) {
        // System.out.println("Warning: found empty line in hunk; ignored");
        // lines.add(' ' + line);
        continue;
      }

      char c = line.charAt(0);
      if (remainingOld == 0 && remainingNew == 0 && c != '@' && c != '\\') {
        return line;
      }

      switch (c) {
        case '@':
          if (line.startsWith("@@ ")) { // $NON-NLS-1$
            // flush old hunk
            if (lines.size() > 0) {
              Hunk.createHunk(
                  diff,
                  oldRange,
                  newRange,
                  lines,
                  encounteredPlus,
                  encounteredMinus,
                  encounteredSpace);
              lines.clear();
            }

            // format: @@ -oldStart,oldLength +newStart,newLength @@
            extractPair(line, '-', oldRange);
            extractPair(line, '+', newRange);
            remainingOld = oldRange[1];
            remainingNew = newRange[1];
            continue;
          }
          break;
        case ' ':
          encounteredSpace = true;
          remainingOld--;
          remainingNew--;
          lines.add(line);
          continue;
        case '+':
          encounteredPlus = true;
          remainingNew--;
          lines.add(line);
          continue;
        case '-':
          encounteredMinus = true;
          remainingOld--;
          lines.add(line);
          continue;
        case '\\':
          if (line.indexOf("newline at end") > 0) { // $NON-NLS-1$
            int lastIndex = lines.size();
            if (lastIndex > 0) {
              line = lines.get(lastIndex - 1);
              int end = line.length() - 1;
              char lc = line.charAt(end);
              if (lc == '\n') {
                end--;
                if (end > 0 && line.charAt(end) == '\r') end--;
              } else if (lc == '\r') {
                end--;
              }
              line = line.substring(0, end + 1);
              lines.set(lastIndex - 1, line);
            }
            continue;
          }
          break;
        case '#':
          break;
        case 'I':
          if (line.indexOf("Index:") == 0) // $NON-NLS-1$
          break;
          // $FALL-THROUGH$
        case 'd':
          if (line.indexOf("diff ") == 0) // $NON-NLS-1$
          break;
          // $FALL-THROUGH$
        case 'B':
          if (line.indexOf("Binary files differ") == 0) // $NON-NLS-1$
          break;
          // $FALL-THROUGH$
        default:
          break;
      }
      return line;
    }
  } finally {
    if (lines.size() > 0)
      Hunk.createHunk(
          diff, oldRange, newRange, lines, encounteredPlus, encounteredMinus, encounteredSpace);
  }
}

/**
 * Draws the category labels and returns the updated axis state.
 *
 * @param g2 the graphics device (<code>null</code> not permitted).
 * @param plotArea the plot area (<code>null</code> not permitted).
 * @param dataArea the area inside the axes (<code>null</code> not permitted).
 * @param edge the axis location (<code>null</code> not permitted).
 * @param state the axis state (<code>null</code> not permitted).
 * @param plotState collects information about the plot (<code>null</code> permitted).
 * @return The updated axis state (never <code>null</code>).
 */
protected AxisState drawSubCategoryLabels(
    Graphics2D g2,
    Rectangle2D plotArea,
    Rectangle2D dataArea,
    RectangleEdge edge,
    AxisState state,
    PlotRenderingInfo plotState) {

  if (state == null) {
    throw new IllegalArgumentException("Null 'state' argument.");
  }

  g2.setFont(this.subLabelFont);
  g2.setPaint(this.subLabelPaint);
  CategoryPlot plot = (CategoryPlot) getPlot();
  int categoryCount = 0;
  CategoryDataset dataset = plot.getDataset();
  if (dataset != null) {
    categoryCount = dataset.getColumnCount();
  }

  double maxdim = getMaxDim(g2, edge);
  for (int categoryIndex = 0; categoryIndex < categoryCount; categoryIndex++) {

    double x0 = 0.0;
    double x1 = 0.0;
    double y0 = 0.0;
    double y1 = 0.0;
    if (edge == RectangleEdge.TOP) {
      x0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      x1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      y1 = state.getCursor();
      y0 = y1 - maxdim;
    } else if (edge == RectangleEdge.BOTTOM) {
      x0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      x1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      y0 = state.getCursor();
      y1 = y0 + maxdim;
    } else if (edge == RectangleEdge.LEFT) {
      y0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      y1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      x1 = state.getCursor();
      x0 = x1 - maxdim;
    } else if (edge == RectangleEdge.RIGHT) {
      y0 = getCategoryStart(categoryIndex, categoryCount, dataArea, edge);
      y1 = getCategoryEnd(categoryIndex, categoryCount, dataArea, edge);
      x0 = state.getCursor();
      x1 = x0 + maxdim;
    }
    Rectangle2D area = new Rectangle2D.Double(x0, y0, (x1 - x0), (y1 - y0));
    int subCategoryCount = this.subCategories.size();
    float width = (float) ((x1 - x0) / subCategoryCount);
    float height = (float) ((y1 - y0) / subCategoryCount);
    float xx = 0.0f;
    float yy = 0.0f;
    for (int i = 0; i < subCategoryCount; i++) {
      if (RectangleEdge.isTopOrBottom(edge)) {
        xx = (float) (x0 + (i + 0.5) * width);
        yy = (float) area.getCenterY();
      } else {
        xx = (float) area.getCenterX();
        yy = (float) (y0 + (i + 0.5) * height);
      }
      String label = this.subCategories.get(i).toString();
      TextUtilities.drawRotatedString(
          label, g2, xx, yy, TextAnchor.CENTER, 0.0, TextAnchor.CENTER);
    }
  }

  if (edge.equals(RectangleEdge.TOP)) {
    double h = maxdim;
    state.cursorUp(h);
  } else if (edge.equals(RectangleEdge.BOTTOM)) {
    double h = maxdim;
    state.cursorDown(h);
  } else if (edge == RectangleEdge.LEFT) {
    double w = maxdim;
    state.cursorLeft(w);
  } else if (edge == RectangleEdge.RIGHT) {
    double w = maxdim;
    state.cursorRight(w);
  }
  return state;
}
